(91, 'conditions', 'GET IMPRESSED - Privacy\r\n(Information pursuant to General Data Protection Regulation\r\n(GDPR) UE 2016/679 and, where applicable, to D.Lgs. 196/2003)\r\n\r\n1. Data controller \r\nGET IMPRESSED S.r.l. with registered offices in Via Vittime delle Foibe 2 - 10073 Ciriè (Italia) (the “Society”, “GET IMPRESSED” or the “Title holder”) ensures to follow the requirements of the GDPR by providing the following information about processing personal data that are either communicated/given or collected when browsing this website. \r\n\r\n2. Processed data, purposes and legal framework \r\nData collected when accessing the website \r\nOur computer system and software collect during their normal activities some personal data whose transmission is implied by Internet protocols. \r\nThese data (such as domain names, IP addresses, operating system in use, device, browser used for connection) do not contain any personal information and they are used for: i) obtain anonymous statistics about the how users deal with the website; ii) control how the website is used, iii) check responsibilities in case of supposed cyber-crimes. \r\nThe legal framework which allows personal data processing is the actual need for putting into practice the website features after the user’s login.\r\n\r\nPersonal data provided voluntarily by the user \r\nPersonal data provided by the user through the form are collected and treated for the following purposes:\r\n\r\nAllowing the business relationship with the customer according to the contract regulation. In case of a trial period of the services of provided by GET IMPRESSED the data collected might be used to check the overall experience when the trial period is over;\r\nFor administrative purposes and to comply with legal obligations connected for instance with accountancy, tax administration or to carry out requests from legal authorities;\r\nWhen specifically agreed, to send out newsletter and promotional material via email;\r\nWhen specifically agreed, to receive updates about our activities and new posts on our blog;\r\nWhen specifically agreed, to receive advertisement and invitations to events, training courses, webinar, special promotions or to take part in market analysis or researches;\r\nWhen receiving a curriculum vitae, for recruitment purposes only.\r\nThe legal framework which allows personal data processing is the execution of a contract where the people concerned are themselves part of the contract execution. The legal framework is the agreement freely given by the people concerned. \r\n\r\nData collected through the Website GET IMPRESSED\r\nFor complete information, be aware that GET IMPRESSED makes use of its own Website GET IMPRESSED for sending out information; it allows to detect the opening of a message, clicks on hyperlink in emails, which IP address or browser type are used to open an email, and so on, trough statistic tracking systems, like web beacons. Data collection is part of the website functioning and it represents an essential part of the system of the sending out of the messages. \r\nThe legal framework which allows personal data processing is the execution of the contract of which the people concerned are part. \r\n\r\n3. Provision of personal data\r\nBesides what has been specified on navigation data and on data collected through GET IMPRESSED Website, data supply:\r\n\r\nAccording to the purposes as explained in a), b) and f) is optional but when the agreement for data supply is refused it will be impossible for GET IMPRESSED to comply with its contractual obligations.\r\nAccording to the purposes as explained in c), d) and e) it is also optional, and their use depends on an explicit agreement. Any refusal will make it impossible for GET IMPRESSED to send newsletters and advertising material, or invitations to events and GET IMPRESSED initiatives.\r\n\r\n\r\n4. Storage period of the data and archiving\r\nData collected will be processed through electronic or automatic tools, or manually. They will be processed according to the aims for which they have been collected; in any case, they will be treated according to security standards. Data will be kept for as long as it will be necessary to comply with the objectives for which they have followed current standards and legal obligations. \r\n\r\nIn any case GET IMPRESSED follows obligations that forbid data storage for an indefinite period and restrict storage time in compliance with the principle of data minimization. \r\n\r\n5. Authorized persons and data communication \r\nData processing is made by GET IMPRESSED internal staff, who has been authorized according to specific instructions in compliance with the laws in force. \r\n\r\nIt is possible that personal data will be transmitted for any reason to a third party, namely:\r\n\r\nsocieties that are part of our corporation as explained in 1 lett. a), b) and f);\r\npeople, societies, associations or professional studies that act as our consultants, for aims described in 1 lett. b) and f);\r\nsocieties, associations that offer services connected to the aim described here above (analysis and market research, payments through credit card, mainteinance of computer systems).\r\nData collected might also be transferred abroad to societies that are and are not part of our corporation, even outside of the European Union in compliance with the laws in force respecting the security implied. \r\n\r\nIn any case, personal data will not be diffused. \r\n\r\n6. Rights of the people concerned\r\nYou can access your data at any time, besides exercising your right to refusal, rectification and removal of data collected by GET IMPRESSED, claiming your right to limitation to data processing and right to data portability, by sending an email to privacy@getimpressed.eu\r\n\r\n', '', '2018-11-25 13:25:28', '2018-11-25 13:25:28'),
